export class ImagePlayer extends HTMLElement {
  static get observedAttributes() {
    return ['src', 'duration', 'currenttime', 'controls', 'autoplay', 'loop', 'width', 'height']
  }

  currentTime = 0
  srcset: string[]

  constructor() {
    super()
    const template = document.createElement('template')
    template.innerHTML = `
      <div class="image-player" style="font-size: 30px;">
        <img id="cur-img" src=""/>
      </div>
    `
    this.srcset = []
    this.attachShadow({ mode: 'open' }).appendChild(template.content.cloneNode(true))
    const imgEl = this.shadowRoot?.querySelector('#cur-img')
    let src = "data:image/png;base64,"
    imgEl!.setAttribute('src', src)
  }

}

export function usePlayer() {
  customElements.define('image-player', ImagePlayer)
}